import React from "react";
import Header from "../Header/Index";
import "./css/styles.css";
import Table from "./Table";
import { Col, Row } from "antd";
const Index = (props) => {
  return (
    <div>
     <Row>
       <Col flex={0.5}><Header/></Col>
       <Col flex={4.5}><Table/></Col>
     </Row>
     
    </div>
  );
};

export default Index;
